import React from 'react';
import { useEffect } from 'react';
import Projects from './Projects';
import { useNavigate } from 'react-router-dom';
const AboutMe = () => 
 {
  let login;
  const navigate = useNavigate();
             useEffect(() => {
                         callaboutpage(); 
                             })

              const callaboutpage = async() => {

                     try {
                         const res = await fetch('/aboutme', {
                         method:"GET",
                          header:{
                          Accept:"application/json",
                        "Content-Type": "application/json"
                         },
                         credentials:"include"
                        });
                      if (res.status === 401){
                           navigate('/login') 
                           console.log('login')       
                           }
                       else{
                        login = true;
                        console.log('login')
                       }
                    }
                    
                         catch (error) {
                        navigate('/login')
                        console.log('error')
                        }
                      }
 if(login === true){
  return (
    <div>
      <form method="GET">
        <Projects />
        </form>
    </div>
  )
 }
 else{
 return(
  <h2>error</h2>
 )
 }
}
  
export default AboutMe;
